import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';

const ChangelogContainer = styled(motion.div)`
  margin-bottom: 40px;
`;

const ChangelogTitle = styled(motion.div)`
  text-align: center;
  margin-bottom: 40px;
  
  h1 {
    font-family: 'Press Start 2P', cursive;
    font-size: clamp(1.8em, 5vw, 3em);
    color: #ff4081;
    text-transform: uppercase;
    text-shadow: 0 0 10px rgba(255, 64, 129, 0.5);
  }
`;

const ChangelogHeader = styled(motion.div)`
  display: flex;
  justify-content: space-between;
  align-items: center;
  background: rgba(40, 40, 60, 0.9);
  padding: 15px 20px;
  border-radius: 10px 10px 0 0;
  border: 1px solid rgba(255, 64, 129, 0.3);
  border-bottom: none;
  backdrop-filter: blur(10px);
  
  h2 {
    font-family: 'Press Start 2P', cursive;
    font-size: clamp(1.2em, 3vw, 1.8em);
    color: #ff4081;
    margin: 0;
    text-transform: uppercase;
  }
  
  @media (max-width: 768px) {
    flex-direction: column;
    align-items: flex-start;
    gap: 10px;
  }
`;

const ChangelogList = styled(motion.div)`
  background: rgba(40, 40, 60, 0.9);
  border: 1px solid rgba(255, 64, 129, 0.3);
  border-top: none;
  border-radius: 0 0 10px 10px;
  overflow: hidden;
  backdrop-filter: blur(10px);
`;

const ChangelogEntry = styled(motion.div)`
  padding: 15px 20px;
  border-bottom: 1px solid rgba(255, 64, 129, 0.2);
  transition: all 0.3s ease;
  cursor: pointer;
  
  &:hover {
    background: rgba(50, 50, 70, 0.9);
    transform: translateX(5px);
    box-shadow: inset 5px 0 0 rgba(255, 64, 129, 0.5);
  }
  
  &:last-child {
    border-bottom: none;
  }
  
  h3 {
    font-family: 'Roboto', sans-serif;
    font-size: clamp(1.2em, 3vw, 1.5em);
    color: #ff4081;
    margin-bottom: 10px;
    font-weight: 600;
  }
  
  p {
    font-size: clamp(0.9em, 2vw, 1em);
    color: #b0b0c0;
    margin-bottom: 10px;
    line-height: 1.6;
    
    strong {
      color: #e0e0e0;
    }
  }
  
  .read-more {
    color: #ff4081;
    font-family: 'Roboto', sans-serif;
    font-size: clamp(0.8em, 2vw, 0.9em);
    text-decoration: none;
    transition: color 0.3s;
    font-weight: 600;
    
    &:hover {
      color: #e03570;
      text-decoration: underline;
    }
  }
`;

const ChangelogSection = () => {
  const [ref, inView] = useInView({
    triggerOnce: true,
    threshold: 0.2
  });

  const containerVariants = {
    hidden: { opacity: 0, y: 50 },
    visible: {
      opacity: 1,
      y: 0,
      transition: {
        duration: 0.6,
        staggerChildren: 0.1
      }
    }
  };

  const itemVariants = {
    hidden: { opacity: 0, y: 30 },
    visible: {
      opacity: 1,
      y: 0,
      transition: { duration: 0.5 }
    }
  };

  const changelogs = [
    {
      title: 'Patch 1.3 - "Floor 7 Unleashed"',
      date: 'Feb 27, 2025',
      changes: [
        'Introduced Floor 7 with "Nether Wraith" mobs.',
        'Added "Blaze Strike" enchantment.',
        'Fixed various bugs and improved performance.'
      ]
    },
    {
      title: 'Patch 1.2 - "Guild Wars"',
      date: 'Feb 20, 2025',
      changes: [
        'Guild overhaul with shared vaults.',
        'Outposts added for rare drops.',
        'New guild ranking system implemented.'
      ]
    },
    {
      title: 'Patch 1.1 - "Energy Boost"',
      date: 'Feb 13, 2025',
      changes: [
        'Energy system rework for better balance.',
        'New enchantments and weapon types.',
        'Quality of life improvements.'
      ]
    }
  ];

  return (
    <ChangelogContainer
      ref={ref}
      variants={containerVariants}
      initial="hidden"
      animate={inView ? "visible" : "hidden"}
    >
      <ChangelogTitle variants={itemVariants}>
        <h1>Recent Changelogs</h1>
      </ChangelogTitle>
      
      <ChangelogHeader variants={itemVariants}>
        <h2>Latest Updates</h2>
      </ChangelogHeader>
      
      <ChangelogList>
        {changelogs.map((changelog, index) => (
          <ChangelogEntry
            key={index}
            variants={itemVariants}
            whileHover={{ 
              x: 5,
              transition: { duration: 0.2 }
            }}
          >
            <h3>{changelog.title}</h3>
            <p><strong>Date:</strong> {changelog.date}</p>
            {changelog.changes.map((change, changeIndex) => (
              <p key={changeIndex}>- {change}</p>
            ))}
            <Link to={`/updates/${index + 1}`} className="read-more">Read More</Link>
          </ChangelogEntry>
        ))}
      </ChangelogList>
    </ChangelogContainer>
  );
};

export default ChangelogSection;
